import styled, { css } from 'styled-components';

export const Title = styled.h1`
  font-size: 48px;
  color: #3A3A3A;
  margin-top: 80px;
  max-width: 450px;
  line-height: 56px;
`;

export const Form = styled.form`
  display: flex;
  max-width: 700px;
  margin-top: 40px;
`;

export const FormItemStyles = css``;

export const Input = styled.input`
  ${FormItemStyles}
  flex: 1;
`;

export const SubmitButton = styled.form`
  ${FormItemStyles}
  width: 210px;
`;
